import axios from 'axios';


export async function fetchPendingRequest(user) {
    axios
        .get('http://localhost:5000/api/admin/pendingRequest', {params: { userId: user.id }})
        .then((response) => {
            return response.data.pendingRequests;
        }).catch((err) => {
            localStorage.removeItem('user');
            localStorage.removeItem('token');
            console.error(err);
            return [];
        });
}
